import logo from "./img/S_logo.png";
import { Squeeze as Hamburger } from "hamburger-react";

const Topbar = () => {
  return (
    <div id="Topbar" className="flex">
      <div id="title" className="flex">
        <div id="title-logo ">
          <img src={logo} alt="logo" srcset="" />
        </div>
        <div id="title-name">
          <p>Mate.ly</p>
        </div>
      </div>
      <div id="menu-button">
        <Hamburger />
      </div>
    </div>
  );
};
export default Topbar;
